import React from "react";
import "./Jumbotron.css";
import JumbotronImage from "../../jumbotronImage.png";

function Jumbotron() {
  return (
    <div className="jumbotron text-center">
      <img src={JumbotronImage} alt="ManUTD Jumbotron"/>
    </div>
  );
}

export default Jumbotron;
